import '../../App.css';

function Contact() {
    return (
        <div className='contact'>
        <div classNAme='aboutContainer'>
            <h1 style={{fontSize: 100, padding: 50}}> Contact me </h1>

            <div align="left">
            <p style={{fontSize: 50, padding: 50}}> Email: Elizabeth.Coxon@coxonartworks.com </p>
            <p style={{fontSize: 50, padding: 50}}> I love to make stuff </p>
            </div>
        </div>
        </div>
    )
}

export default Contact
